import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const ali = ['prominent', 'schema', 'conscience']
  const paul = [ 'rich', 'nobles', 'aesthetic']

  return (
    <div className="App">
       <h1> + {1+9} + {7*3} </h1>
       <h2>{"prominent_profile".toUpperCase()} </h2>
       <div>
         <p>{ ali.map(item =>" word : "+ item  + ", ")} are random words  </p>
         <p>{ paul.map(x => x+', ')} </p>
       </div>
    </div>
  );
}

export default App;
